import React from 'react';

const Cards = ({ person, key }) => {
	return(
		<div>
			<img src="https://images-na.ssl-images-amazon.com/images/I/41IXITCtVwL._SL500_AC_SS350_.jpg"/>		
			<h1>{ person.name }</h1>
			<h2>{ person.height }</h2>
			<h2>{ person.eye_color }</h2>
			<h2>{ person.hair_color }</h2>
			<h2>{ person.skin_color }</h2>
			<h2>{ person.eye_color }</h2>
			<h2>{ person.birth_year }</h2>
			<h2>{ person.gender }</h2>
			<br/>
		</div>			
	)
}

export default Cards;
